var lossesData = prepCsvData(lossesDump);

var parsedLossData = parseCSV(lossesDump);

var cattleLossData = parsedLossData.filter(function(d) {
  return d["Data Item"] == "CATTLE, (EXCL CALVES) - LOSS, DEATH, MEASURED IN HEAD";
});

var calvesLossData = parsedLossData.filter(function(d) {
  return d["Data Item"] == "CATTLE, CALVES - LOSS, DEATH, MEASURED IN HEAD";
});

var allLossData = [];

cattleLossData.forEach(function(cattle) {
  var calves = calvesLossData.filter(function(calf) {
    return cattle.State == calf.State &&
      cattle.Year == calf.Year;
  })[0];
  var all = _.cloneDeep(cattle);
  all.Value += calves.Value;
  all["Data Item"] = '__ALL__';
  allLossData.push(all);
});

