var getTotalFromLoss = function(state, year, type) {
  var data = type == 'cattle' ?
    cattleLossData :
    calvesLossData ;
  var inv = data.filter(function(d) {
    return d.State == state && 
      d.Year == year;
  });
  return inv[0].Value;
}

